interface Category {
  categoryName: string;
}

class ProductModel {
  productId: number;
  discount: number;
  rating: number;
  price: number;
  productName: string;
  productDescription: string;
  discountedPrice:number;
  constructor(
    productId: number,
    discount: number,
    rating: number,
    price: number,
    productName: string,
    productDescription: string,
    discountedPrice:number,
  ) {
    this.productId = productId;
    this.discount = discount;
    this.rating=rating;
    this.price = price;
    this.productName = productName;
    this.productDescription = productDescription;
    this.discountedPrice = discountedPrice;
  }
}
export default ProductModel;
